import { useEffect, useState } from "react";
import { Link } from 'react-router-dom';

const Movies = () => {
    const [movies, setMovies] = useState([]);

    setMovies("Titanic")

    return(
        <div>
            <h2>Movies</h2>
            <hr />
            <table className="table table-striped table-hover">
                <thead>
                    <tr>
                        <th>Movie</th>
                        <th>Release Date</th>
                        <th>Rating</th>
                    </tr>
                </thead>
                <tbody>
                    {movies}
                </tbody>
            </table>
        </div>
    )
}

export default Movies;
